import React from "react";

const PrivacyPolicy = () => {
  return (
    <div style={{ padding: "20px", textAlign: "center" }}>
      <h1>Privacy Policy</h1>
      <p>This is the Privacy Policy page for Canvas of Care.</p>
      <p>We value your privacy and ensure your data is protected.</p>
    </div>
  );
};

export default PrivacyPolicy;
